pragma solidity >=0.4.0 <0.7.0;
import './SafeMath.sol';

library IterableMapping {event __CoverageIterableMapping(string fileName, uint256 lineNumber);
event __FunctionCoverageIterableMapping(string fileName, uint256 fnId);
event __StatementCoverageIterableMapping(string fileName, uint256 statementId);
event __BranchCoverageIterableMapping(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageIterableMapping(string fileName, uint256 branchId);
event __AssertPostCoverageIterableMapping(string fileName, uint256 branchId);

    struct file {
        mapping(uint => IndexValue) data;
        KeyFlag[] keys;
        uint size;
    }

    struct IndexValue {
        uint keyIndex;
        uint goal;
        string fileLink;
        string title;
        string description;
        address payable goalAddress;
        uint donated;
        uint dateCreated;
        bool isGoalReached;
    }
    struct KeyFlag { uint key; bool deleted; }

    function insert(
        file storage self,
        uint _goal,
        string memory _fileLink,
        string memory _title,
        string memory _description,
        address payable _goalAddress
    ) internal returns (uint) {emit __FunctionCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',1);

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',32);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',1);
if (self.size == 0) {emit __BranchCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',1,0);self.keys.length++;}else { emit __BranchCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',1,1);}


emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',34);
        self.size++;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',35);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',2);
self.data[self.size].goal = _goal;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',36);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',3);
self.data[self.size].fileLink = _fileLink;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',37);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',4);
self.data[self.size].title = _title;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',38);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',5);
self.data[self.size].description = _description;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',39);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',6);
self.data[self.size].goalAddress = _goalAddress;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',40);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',7);
self.data[self.size].dateCreated = block.timestamp;

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',42);
        self.keys.length++;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',43);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',8);
self.data[self.size].keyIndex = self.size;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',44);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',9);
self.keys[self.size].key = self.size;

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',46);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',10);
return self.data[self.size].keyIndex;
    }

    function donate(file storage self, uint _index, uint _value) internal returns(uint, bool) {emit __FunctionCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',2);

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',50);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',11);
self.data[_index].donated = SafeMath.add(self.data[_index].donated, _value);
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',51);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',12);
if (self.data[_index].donated >= self.data[_index].goal) {emit __BranchCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',2,0);
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',52);
            emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',13);
self.data[_index].isGoalReached = true;
        }else { emit __BranchCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',2,1);}

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',54);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',14);
return (self.data[_index].donated, self.data[_index].isGoalReached);
    }

    function resetDonated(file storage self, uint _index) internal returns(bool) {emit __FunctionCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',3);

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',58);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',15);
self.data[_index].donated = 0;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',59);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',16);
return true;
    }

    function contains(file storage self, uint key) internal      returns (bool) {emit __FunctionCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',4);

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',63);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',17);
return self.data[key].keyIndex > 0;
    }

    function isFileOwner(file storage self, uint _index, address _fileOwner) internal      returns(bool) {emit __FunctionCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',5);

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',67);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',18);
return self.data[_index].goalAddress == _fileOwner;
    }

    function hasFunds(file storage self, uint _index) internal      returns(bool) {emit __FunctionCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',6);

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',71);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',19);
return (self.data[_index].isGoalReached == true) && (self.data[_index].donated > 0);
    }

    function firstIndex(file storage self) internal      returns (uint keyIndex) {emit __FunctionCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',7);

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',75);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',20);
return nextIndex(self, uint(0));
    }

    function isValid(file storage self, uint keyIndex) internal      returns (bool) {emit __FunctionCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',8);

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',79);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',21);
return keyIndex < self.keys.length;
    }

    function nextIndex(file storage self, uint keyIndex) internal      returns (uint) {emit __FunctionCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',9);

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',83);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',22);
uint r_keyIndex = keyIndex + 1;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',84);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',23);
while (r_keyIndex < self.keys.length && self.keys[r_keyIndex].deleted) {r_keyIndex++;}
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',85);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',24);
return r_keyIndex;
    }

    function get(
        file storage self,
        uint keyIndex
    ) internal      returns (
        uint key,
        uint goal,
        string memory fileLink,
        string memory title,
        string memory description,
        address payable goalAddress,
        uint donated,
        uint dateCreated,
        bool isGoalReached
    ) {emit __FunctionCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',10);

emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',102);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',25);
key = self.keys[keyIndex].key;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',103);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',26);
goal = self.data[key].goal;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',104);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',27);
fileLink = self.data[key].fileLink;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',105);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',28);
title = self.data[key].title;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',106);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',29);
description = self.data[key].description;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',107);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',30);
goalAddress = self.data[key].goalAddress;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',108);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',31);
donated = self.data[key].donated;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',109);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',32);
dateCreated = self.data[key].dateCreated;
emit __CoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',110);
        emit __StatementCoverageIterableMapping('/Volumes/Data/Projects/Unlock-dApp/contracts/IterableMapping.sol',33);
isGoalReached = self.data[key].isGoalReached;
    }
}
